import "./about.css";
import me from "../../img/me.png"

const About = () => {
    return (
        <div>
            <div className="left">
              <div className="box d-flex">
                  <div className="c-img">
                    <img src={me} alt="me" />
                  </div>
                  <div className="details">
                    <h1>About</h1>
                  </div>
              </div>
            </div>
        </div>
    );
};

export default About;
